"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:600;\">Проверка директории с файлами зависимостями. При обнаружении заражённых файлов, папок, в процессе проверки. они будут удалены!</span></p>\n"
